from functools import lru_cache
import random

# brute force optimum for small arrays

def opt(arr):
    @lru_cache(None)
    def dp(state):
        if len(state) <= 1:
            return 0
        best = 0
        for i in range(len(state)-1):
            score = abs(state[i] - state[i+1]) + dp(state[:i] + state[i+2:])
            if score > best: best = score
        return best
    return dp(tuple(arr))

# dp interval with option to skip leftmost

def dp_interval_skip(arr):
    n = len(arr)
    from functools import lru_cache
    @lru_cache(None)
    def dp(l,r):
        if l>=r: return 0
        best = dp(l+1,r) # skip l (leave unmatched)
        for k in range(l+1, r+1):
            if (k-l)%2==1:
                val = abs(arr[l]-arr[k]) + dp(l+1, k-1) + dp(k+1, r)
                if val > best: best = val
        return best
    return dp(0, n-1)

# test random
for n in range(2,9):
    for _ in range(200):
        arr = [random.randint(0,9) for _ in range(n)]
        a = opt(arr)
        b = dp_interval_skip(arr)
        if a!=b:
            print('mismatch!', arr, a, b)
            raise SystemExit
print('all match up to 8')
